import React, { useState } from "react";
import styled from "styled-components";


const Container = styled.div`
  width: 100%;
  height: 100vh;
`;

export const Post = () => {
  const [showNav, setShowNav] = useState(true);

  return (
    <Container>
      <div>
        <div></div>
        <button>Get Started</button>
      </div>
    </Container>
  );
};
